      Hint: ExtendedContent
      Value: "<p>Kaytee Timothy Complete Plus Flowers &amp; Herbs Guinea Pig Food was developed by an animal nutrition expert to ensure your small pet gets the proper nutrition for a long, healthy life. Timothy Complete is a pelleted food made with nutritious hand-selected Timothy Hay and essential vitamins and nutrients necessary for your Guinea Pig. Timothy Complete is high in fiber to support digestive health and contains long-lasting vitamin C.<br> <br> Kaytee understands that sharing your life with a pet is not only enjoyable but very enriching. Kaytee shows our love by ensuring we provide your pet with the best nutrition for a long and healthy life. With over 150 years of nutritional experience, it's no wonder why Kaytee is at the heart of every healthy feeding routine.</p>"
